 {name: '9 of Clubs', suit: 'c', rank: '9'},
 {name: '10 of Clubs', suit: 'c', rank: '10'},
 {name: 'Jack of Clubs', suit: 'c', rank: 'j'},
 {name: 'Queen of Clubs', suit: 'c', rank: 'q'},
 {name: 'King of Clubs', suit: 'c', rank: 'k'},
 {name: 'Ace of Diamonds', suit: 'd', rank: 'a'},
 {name: '2 of Diamonds', suit: 'd', rank: '2'},
 {name: '3 of Diamonds', suit: 'd', rank: '3'},
 {name: '4 of Diamonds', suit: 'd', rank: '4'},
 {name: '5 of Diamonds', suit: 'd', rank: '5'},
 {name: '6 of Diamonds', suit: 'd', rank: '6'},
 {name: '7 of Diamonds', suit: 'd', rank: '7'},
 {name: '8 of Diamonds', suit: 'd', rank: '8'},
 {name: '9 of Diamonds', suit: 'd', rank: '9'},
 {name: '10 of Diamonds', suit: 'd', rank: '10'},
 {name: 'Jack of Diamonds', suit: 'd', rank: 'j'},
 {name: 'Queen of Diamonds', suit: 'd', rank: 'q'},
 {name: 'King of Diamonds', suit: 'd', rank: 'k'},
 {name: 'Ace of Spades', suit: 's', rank: 'a'},
 {name: '2 of Spades', suit: 's', rank: '2'},
 {name: '3 of Spades', suit: 's', rank: '3'},
 {name: '4 of Spades', suit: 's', rank: '4'},
 {name: '5 of Spades', suit: 's', rank: '5'},
 {name: '6 of Spades', suit: 's', rank: '6'},
 {name: '7 of Spades', suit: 's', rank: '7'},
 {name: '8 of Spades', suit: 's', rank: '8'},
 {name: '9 of Spades', suit: 's', rank: '9'},
 {name: '10 of Spades', suit: 's', rank: '10'},
 {name: 'Jack of Spades', suit: 's', rank: 'j'},
 {name: 'Queen of Spades', suit: 's', rank: 'q'},
 {name: 'King of Spades', suit: 's', rank: 'k'},
]

function pile_offset(index) {
  return {
    x: 0.2 * index,
    y: 0.66 * index,
  }
}

var poker_deck = {

  flip_handler: function(evt) {
    var deck

    if (evt.target.classList.contains('poker_deck')) {
      deck = evt.target
    } else {
      deck = evt.target.querySelector('.poker_deck')
    }
    local_doc = deck.closest('.svg_poker_deck')

    play_area_group = local_doc.querySelector('#play_area')

    var card

    if (evt.detail.selectedCardId) {
      // user is dragging a card
      card = SVG.adopt(byId(evt.detail.selectedCardId))
    } else if (deck.childNodes.length !== 0) {
      // take the top card off the deck
      card = SVG.adopt(deck.lastChild)
    } else {
      console.log('no card')
      return;
    }

    play_area_pos = local_doc.querySelector('#play_area_ellipse')
    play_area_pos = SVG.adopt(play_area_pos)

    offset = pile_offset(play_area_group.childNodes.length)
    card.cx(play_area_pos.cx() + offset.x)
    card.cy(play_area_pos.cy() - 50 + offset.y)

    poker_deck.flip_card_to_front(card)

    card.remove() // remove from deck
    play_area_group.appendChild(card.node)
  },

  flip_card_to_front: function(card) {
    back = card.node.querySelector('.card_back')
    back.remove()
    card.node.insertBefore(back, card.node.firstChild)
  },

  flip_card_to_back: function(card) {
    back = card.node.querySelector('.card_back')
    back.remove()
    card.node.appendChild(back)
  },

  reshuffle_handler: function(evt) {
    var deck

    if (evt.target.classList.contains('poker_deck')) {
      deck = evt.target
    } else {
      deck = evt.target.querySelector('.poker_deck')
    }
    local_doc = deck.closest('.svg_poker_deck')

    cardArray = []
    sDeck = SVG.adopt(deck)
    local_doc.querySelectorAll('.of_' + deck.id).forEach((card) => {
      card.remove()
      cardArray.push(card)
    })
    shuffle(cardArray).map((card) => {
      sCard = SVG.adopt(card)
      poker_deck.endeck(sDeck, sCard)
    })

  },

  generate_card: function(cardJSON, deck_id) {
    back_group = document.querySelector('#g_back')
    trans_x = 0 - SVG.adopt(back_group.firstElementChild).x()
    trans_y = 0 - SVG.adopt(back_group.firstElementChild).y()
    back = SVG.adopt(back_group.querySelectorAll('rect')[0])
    back_trans = ' x="' + trans_x + '" y="' + trans_y + '" '

    href = '#g_' + cardJSON.suit + cardJSON.rank
    front_group = document.querySelector(href)
    trans_x = 0 - SVG.adopt(front_group.firstElementChild).x()
    trans_y = 0 - SVG.adopt(front_group.firstElementChild).y()
    front_trans = ' x="' + trans_x + '" y="' + trans_y + '" '

    var cardText = cardJSON.name
    var card = document.createElementNS(SVG.ns, 'svg')
    card.dataset.name = cardJSON.name
    card.dataset.suit = cardJSON.suit
    card.dataset.rank = cardJSON.rank
    card.dataset.deckId = deck_id
    card.id = deck_id + '_' + cardJSON.suit + cardJSON.rank

    card.innerHTML = (
      `<use `+ front_trans +` class="card_front" href="`+ href +`" />` +
      `<use `+ back_trans + ` class="card_back" href="#g_back" />`
    )
    card = SVG.adopt(card)
    card.width(back.width())
    card.height(back.height())
    card.addClass('draggable-group')
    card.addClass('poker_card')
    card.addClass('of_' + deck_id)
    card.node.addEventListener('svg_dragstart', (evt) => {
      if (evt.detail.elemId === card.node.id) {
        console.log('its me', card.node.id)
      }
    })
    return card
  },

  endeck: function(deck, card) {
    local_doc = deck.node.closest('.svg_poker_deck')
    deck_area = local_doc.querySelector('#g_deck_area')
    index = deck.node.querySelectorAll('.poker_card').length
    deck_area = SVG.adopt(deck_area)
    poker_deck.flip_card_to_back(card)
    // TODO - why do i need this 20 pixel fudge?
    card.cy(deck_area.cy() - (20 + pile_offset(index).y))
    card.cx(deck_area.cx() + pile_offset(index).x)
    deck.add(card)
  },

  generate_deck: function(elem) {
    handle = SVG(elem)
    deck = handle.group()
    deck.addClass('poker_deck')
    deck_id = 'deck_' + base32.short_id()
    deck.id(deck_id)
    handle.add(deck)

    shuffle(pokerDeckJSON).map((cardJSON) => {
      card = this.generate_card(cardJSON, deck_id)
      this.endeck(deck, card)
    })
  },

  drag_handler: function(evt) {
    card = SVG.get(evt.target.id)
    play_area = SVG.get('ellipse_play_area')

    if (play_area.inside(card.cx(), card.cy())) {
      card.style({ opacity: 0.8 })
    } else {
      card.style({ opacity: 1.0 })
    }
  },

  dragend_handler: function(evt) {
    play_area = SVG.get('ellipse_play_area')

    card = SVG.get(evt.target.id)
    card.style({ opacity: 1.0 })

    if (play_area.inside(card.cx(), card.cy())) {
      console.log('1dropped in play area', card.node.dataset.deckId)
      deck = byId(card.node.dataset.deckId)
      evt_fire('poker_deck_flip', deck, evt, {selectedCardId: card.node.id})
    } else {
      console.log('dropped elsewhere')
    }
  },

  initialize: function(elem) {
    this.generate_deck(elem)
    elem.addEventListener('poker_deck_flip', this.flip_handler)
    elem.addEventListener('poker_deck_reshuffle', this.reshuffle_handler)
    byId('ellipse_play_area').classList.add('droptarget')
    elem.addEventListener('svg_drag', this.drag_handler)
    elem.addEventListener('svg_dragend', this.dragend_handler)
  },

  menu: {
    'Flip': {
      eventName: 'poker_deck_flip',
      applicable: (dNode) => {
        deck = dNode.querySelector('.poker_deck')
        if (deck.childNodes.length === 0) {
          return false;
        }
        return true
      },
    },
    'Reshuffle': {
      eventName: 'poker_deck_reshuffle',
      applicable: (dNode) => { return true },
    },
  },

}
